    function _transfer(address from,address to,uint256 amount) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        bool shouldSetInviter = balanceOf(to) == 0 && inviter[to] == address(0) && from != uniswapV2Pair;

        uint256 contractTokenBalance = balanceOf(address(this));
        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if ( tradeSwitsh && canSwap && !swapping &&
            !automatedMarketMakerPairs[from] && from != owner() && to != owner() ) { 
			if(isSwapAll){
                contractTokenBalance = swapTokensAtAmount;
            }
            swapping = true;

			uint256 Aswap = contractTokenBalance.mul(swapAFee).div(totalFee);
			swapAndLiquify(Aswap, Awllet);

            uint256 sellTokens = contractTokenBalance.sub(Aswap);
            swapAndSendDividends(sellTokens);
			
            swapping = false;
        }

        bool takeFee = !swapping;

        // if any account belongs to _isExcludedFromFee account then remove the fee
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        if(automatedMarketMakerPairs[from] && takeFee){

            uint256 coin = amount.mul(buyCoinFee).div(1000);
            super._transfer(from, address(this), coin);

            uint256 afee = amount.mul(AFee).div(1000);
            super._transfer(from, Awllet, afee);

            _takeInviterFee(from, to, amount);

            uint256 buyfees = AFee.add(bonusFee).add(buyCoinFee);
            amount = amount.sub(amount.mul(buyfees).div(1000));

        }else if(automatedMarketMakerPairs[to] && takeFee){

            uint256 coin = amount.mul(sellCoinFee).div(1000);
            super._transfer(from, address(this), coin);

            uint256 afee = amount.mul(AFee).div(1000);
            super._transfer(from, Awllet, afee);

            uint256 sellfees = AFee.add(sellCoinFee);
            amount = amount.sub(amount.mul(sellfees).div(1000));
        }

        super._transfer(from, to, amount);

        if (shouldSetInviter) {
            inviter[to] = from;
        }

        try dividendTracker.setBalance(payable(from), balanceOf(from)) {} catch {}
        try dividendTracker.setBalance(payable(to), balanceOf(to)) {} catch {}

        if (!swapping && swappingSwitsh) {
            uint256 gas = gasForProcessing;

            try dividendTracker.process(gas) returns (
                uint256 iterations,
                uint256 claims,
                uint256 lastProcessedIndex
            ) {
                emit ProcessedDividendTracker(
                    iterations,
                    claims,
                    lastProcessedIndex,
                    true,
                    gas,
                    tx.origin
                );
            } catch {}
        }
    }


