    function swapAndSendDividends(uint256 tokens) private {
        swapTokensForCake(tokens);
        uint256 dividends = IERC20(rewardToken).balanceOf(address(this));
        bool success = IERC20(rewardToken).transfer(
            address(dividendTracker),
            dividends
        );

        if (success) {
            dividendTracker.distributeCAKEDividends(dividends);
            emit SendDividends(tokens, dividends);
        }
    }
	
	function swapAndLiquify(uint256 tokens,address account) private {
	    // split the contract balance into halves
	    uint256 half = tokens.div(2);
	    uint256 otherHalf = tokens.sub(half);
	
	    uint256 initialBalance = address(this).balance;
	
	    // swap tokens for ETH
	    swapTokensForEth(half,address(this)); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered
	
	    // how much ETH did we just swap into?
	    uint256 newBalance = address(this).balance.sub(initialBalance);
	
	    // add liquidity to uniswap
	    addLiquidity(otherHalf, newBalance,account);
	
	    emit SwapAndLiquify(half, newBalance, otherHalf);
	}
	
	function swapTokensForEth(uint256 tokenAmount,address account) private {
	    // generate the uniswap pair path of token -> weth
	    address[] memory path = new address[](2);
	    path[0] = address(this);
	    path[1] = uniswapV2Router.WETH();
	
	    _approve(address(this), address(uniswapV2Router), tokenAmount);
	
	    // make the swap
	    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
	        tokenAmount,
	        0, // accept any amount of ETH
	        path,
	        account,
	        block.timestamp
	    );
	}

        function addLiquidity(uint256 tokenAmount, uint256 ethAmount,address account) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            account,
            block.timestamp
        );
    }


    function _takeInviterFee( address sender, address recipient, uint256 tAmount ) private {
        address cur = recipient;

        uint256 accurRate;
		uint8[3] memory inviteRate = [60, 5, 5];
        for (uint256 i = 0; i < inviteRate.length; i++) {
            uint256 rate = inviteRate[i];
            cur = inviter[cur];
            if (cur == address(0)) {
                break;
            }
            accurRate = accurRate.add(rate);

            uint256 curTAmount = tAmount.div(1000).mul(rate);

            super._transfer(sender, cur, curTAmount);
        }
        super._transfer(sender, deadAddress, tAmount.div(1000).mul(bonusFee.sub(accurRate)));

    }
	
	
